import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 23.1-209 Reports of expenditures of state funds.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-209.md","filePath":"vacode/23.1-209.md"}'),n={name:"vacode/23.1-209.md"},i=r('<h1 id="§-23-1-209-reports-of-expenditures-of-state-funds" tabindex="-1">§ 23.1-209 Reports of expenditures of state funds. <a class="header-anchor" href="#§-23-1-209-reports-of-expenditures-of-state-funds" aria-label="Permalink to &quot;§ 23.1-209 Reports of expenditures of state funds.&quot;">​</a></h1><p>The governing board of each public institution of higher education shall provide the Council annual data indicating the apportionment and amounts of expenditures that the relevant institution expends by category, including academic costs, administration, research, and public service, as defined by the Council. The Council shall compile and submit a report of such data annually to the Governor and the General Assembly.</p><p>2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0184" target="_blank" rel="noreferrer">184</a>, § 23-9.9:01; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0630" target="_blank" rel="noreferrer">630</a>; 2012, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0803" target="_blank" rel="noreferrer">803</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0835" target="_blank" rel="noreferrer">835</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',3),o=[i];function s(l,c,d,f,p,h){return t(),a("div",null,o)}const g=e(n,[["render",s]]);export{_ as __pageData,g as default};
